import React, { useState } from "react";
import { useNavigate } from "react-router-dom";
import "./Register.css";

function Register(): JSX.Element {
  // „Éï„Ç©„Éº„É†„Éá„Éº„Çø„ÅÆÁä∂ÊÖã„ÇíÁÆ°ÁêÜ„Åô„Çã
  const [name, setName] = useState("");
  const [email, setEmail] = useState("");
  const [password, setPassword] = useState("");
  const [confirmPassword, setConfirmPassword] = useState("");
  const [errorMessage, setErrorMessage] = useState("");

  const navigate = useNavigate(); // useNavigate„ÇíÂàùÊúüÂåñ

  // „Éï„Ç©„Éº„É†ÈÄÅ‰ø°ÊôÇ„ÅÆÂá¶ÁêÜ
  const handleSubmit = async (e: React.FormEvent<HTMLFormElement>) => {
    e.preventDefault(); // „Éö„Éº„Ç∏„ÅÆ„É™„É≠„Éº„Éâ„ÇíÈò≤„Åê

    // „Éë„Çπ„ÉØ„Éº„Éâ„Å®Á¢∫Ë™ç„Éë„Çπ„ÉØ„Éº„Éâ„ÅÆÊ§úË®º
    if (password !== confirmPassword) {
      setErrorMessage("„Éë„Çπ„ÉØ„Éº„Éâ„Åå‰∏ÄËá¥„Åó„Åæ„Åõ„Çì„ÄÇ");
      return;
    }
    try {
      // „Çµ„Éº„Éê„Éº„Å∏„ÅÆ„É™„ÇØ„Ç®„Çπ„Éà
      const response = await fetch("http://localhost:5003/auth/register", {
        //„Åì„Åì„ÅåAPI„Ç®„É≥„Éâ„Éù„Ç§„É≥„Éà
        method: "POST",
        headers: {
          "Content-Type": "application/json",
        },
        credentials: "include",
        body: JSON.stringify({ name, email, password }),
      });
      const responseData = await response.json();
      console.log("üì¢ „Çµ„Éº„Éê„Éº„ÅÆ„É¨„Çπ„Éù„É≥„Çπ:", responseData); // ‚úÖ „É¨„Çπ„Éù„É≥„Çπ„ÇíÁ¢∫Ë™ç

      if (response.ok) {
        console.log("ÁôªÈå≤„ÅåÂÆå‰∫Ü„Åó„Åæ„Åó„Åü");
        navigate("/top"); // „É™„ÉÄ„Ç§„É¨„ÇØ„ÉàÂÖà„ÅÆURL„ÇíÊåáÂÆö
      } else {
        setErrorMessage("ÁôªÈå≤„Å´Â§±Êïó„Åó„Åæ„Åó„Åü„ÄÇ");
      }
    } catch (error) {
      setErrorMessage("„Çµ„Éº„Éê„Éº„Ç®„É©„Éº„ÅåÁô∫Áîü„Åó„Åæ„Åó„Åü„ÄÇ");
    }
  };
  return (
    <div className="register-container">
      <header className="register">
        <h1>wan paradise</h1>
        <h2>Êñ∞Ë¶è‰ºöÂì°ÁôªÈå≤</h2>
        <form onSubmit={handleSubmit}>
          <div className="form-group">
            <label htmlFor="name">ÂêçÂâç</label>
            <input
              type="text"
              id="name"
              name="name"
              placeholder="ÂêçÂâç"
              value={name}
              onChange={(e) => setName(e.target.value)}
              required
              aria-label="ÂêçÂâç"
            />
          </div>
          <div className="form-group">
            <label htmlFor="email">„É°„Éº„É´„Ç¢„Éâ„É¨„Çπ</label>
            <input
              type="email"
              id="email"
              name="email"
              placeholder="„É°„Éº„É´„Ç¢„Éâ„É¨„Çπ"
              value={email}
              onChange={(e) => setEmail(e.target.value)}
              required
              aria-label="„É°„Éº„É´„Ç¢„Éâ„É¨„Çπ"
            />
          </div>
          <div className="form-group">
            <label htmlFor="password">„Éë„Çπ„ÉØ„Éº„Éâ</label>
            <input
              type="password"
              id="password"
              placeholder="„Éë„Çπ„ÉØ„Éº„Éâ"
              value={password}
              onChange={(e) => setPassword(e.target.value)}
              required
              aria-label="„Éë„Çπ„ÉØ„Éº„Éâ"
            />
          </div>
          <div className="form-group">
            <label htmlFor="confirmPassword">„Éë„Çπ„ÉØ„Éº„ÉâÁ¢∫Ë™ç</label>
            <input
              type="password"
              id="confirmPassword"
              name="confirmPassword"
              placeholder="„Éë„Çπ„ÉØ„Éº„Éâ„ÇíÂÜçÂÖ•Âäõ"
              value={confirmPassword}
              onChange={(e) => setConfirmPassword(e.target.value)}
              required
              aria-label="„Éë„Çπ„ÉØ„Éº„ÉâÁ¢∫Ë™ç"
            />
          </div>
          <button type="submit">ÁôªÈå≤</button>
        </form>
        {errorMessage && (
          <p id="errorMessage" style={{ color: "red" }}>
            {errorMessage}
          </p>
        )}
      </header>
    </div>
  );
}

export default Register;
